//index.js
const app = getApp()

Page({
  data: {
    slider: [{
      picUrl: "data:image/gif;base64,"
    },
    {
      picUrl: "data:image/gif;base64,"
    },
    {
      picUrl: "data:image/gif;base64,"
    },
    {
      picUrl: ""
    },
    ],
    src:'',
    index:0,
    isPlay:false,
    animationData:"",
    url: 'http://ws.stream.qqmusic.qq.com/M500001VfvsJ21xFqb.mp3?guid=ffffffff82def4af4b12b3cd9337d5e7&uin=346897220&vkey=6292F51E1E384E06DCBDC9AB7C49FD713D632D313AC4858BACB8DDD29067D3C601481D36E62053BF8DFEAF74C0A5CCFADD6471160CAF3E6A&fromtag=46',
  },
  onLoad: function() {
     var that = this
    console.log(typeof (that.data.slider) == 'object')
    that.data.src = app.globalData.picUrl
    this.audioCtx = wx.createAudioContext('myAudio')
    this.animation = wx.createAnimation({duration: 3000,timingFunction: 'ease',})
    this.animation2 = wx.createAnimation({duration: 3000,timingFunction: 'ease',})
    var animation3 = wx.createAnimation({duration: 500,timingFunction: 'ease',})
    var animation4 = wx.createAnimation({duration: 500,timingFunction: 'ease',})
    wx.getSystemInfo({
      success: function(res) {
        console.log(res)
        that.setData({
          Height: res.windowHeight
        });
      },
    })
    that.setData({
      src: that.data.src
    })
    that.audioPlay()
    that.translate()
    that.translate2()
    that.scale()
    that.rotate()
    that.audioPlay()
  },
  onReady: function () {
    this.animation3 = wx.createAnimation({duration: 500, timingFunction: 'ease',})
    this.animation4 = wx.createAnimation({ duration: 500, timingFunction: 'ease', })
  },
  //播放
  audioPlay(){
    this.audioCtx.play()
  },
  //暂停
  audioPause: function () {
    this.audioCtx.pause()
  },
  //图片1动画
  translate: function () {
    var systemInfo = wx.getSystemInfoSync();
    console.log(systemInfo.windowWidth); // 输出 414 （单位 px）
    this.animation.translateX(500 / 750 * systemInfo.windowWidth).step()
    this.setData({ animation: this.animation.export() })
  },
  //图片2动画
  translate2: function () {
    var systemInfo = wx.getSystemInfoSync();
    console.log(systemInfo.windowWidth); // 输出 414 （单位 px）
    this.animation2.translateX(-650 / 750 * systemInfo.windowWidth).step()
    this.setData({ animation2: this.animation2.export() })
  },
  //图片缩放动画
  scale() {
    var next = true;
    //连续动画关键步骤
    setInterval(function () {
      if (next) {
        this.animation3.opacity(1).scale(1,1).step()
        next = !next;
      } else {
        this.animation3.opacity(1).scale(0.95,0.95).step()
        next = !next;
      }
      this.setData({
        animation3: this.animation3.export()
      })
    }.bind(this), 500)
  },
  //图片旋转
  rotate(){
    // var n = 0;
    // setInterval(function () {
    //   n = n + 1;
    //   this.animation4.rotate(15 * (n)).step()
    //   this.setData({
    //     animation4: this.animation4.export()
    //   })
    // }.bind(this), 100)
  },
  audioPlay() {
    this.audioCtx.play()
    this.setData({
      isPlay: false
    })
  },
  //暂停
  audioPause: function () {
    console.log("暂停")
    this.audioCtx.pause()
    this.setData({
      isPlay: true
    })
  },
  //轮播图切换
  onSlideChangeEnd: function (e) {
    console.log(e.detail.current)
    var that = this;
    that.reset()
    that.setData({
      index: e.detail.current 
    })
    // if (that.data.index == 0) {
      that.translate()
      that.translate2()
      that.scale()

    // }
  },
  reset: function () {
    this.animation.rotate(0, 0)
      .scale(1)
      .translateX(0, 0)
      .skew(0, 0)
      .step({ duration: 0 })
    this.animation2.rotate(0, 0)
      .scale(1)
      .translateX(0, 0)
      .skew(0, 0)
      .step({ duration: 0 })
    this.animation3.rotate(0, 0)
      .scale(0)
      .translateX(0, 0)
      .skew(0, 0)
      .step({ duration: 0 })
    this.setData({ 
      animation: this.animation.export(),
      animation2: this.animation2.export(),
      animation3: this.animation3.export() 
      })

  }

})
